const productName = "DJI Air 2S"
function getLastParenthesesContent(str) {
    const regex = /\(([^)]+)\)(?!.*\([^)]*\))/;
    const match = str.match(regex);
    
    return match ? match[1] : null; 
}
function getNameContent(str) {  // MUDEI AQUI
    const result = str
    .replace("(Perform damage assessment for small components and replace the large module)","")
    .replace("(Assess subclass material as damaged)","")
    .replace("(Virtual Layer)","")
    .replace(/<[^>]*>/g, '')
    .replace(/\([^)]*\)$/, '')
    
    return result; 
}


