  const reorganizeByModuleMain  = (data) => {
    const result = {};

    Object.values(data).forEach(array => {
        array.forEach(item => {
            if (item.moduleMain) { // Ignorar itens sem `moduleMain`
                if (!result[item.moduleMain]) {
                    result[item.moduleMain] = { items: [], typeMain: "DJI",replace:false }; // Inicializa o módulo
                }
                result[item.moduleMain].items.push(item);

                if(item.replace) {
                    result[item.moduleMain].replace = true
                    result[item.moduleMain].pnMain = item.consumable
                }
                if (item.type === "Danificado" || item.type === "Desgaste" || item.type === "Danos Leve" ) {
                    result[item.moduleMain].typeMain = "Account";
                }
            }
        });
    });

    return result;
};
